@pytest.mark.parametrize("idx", [
    _ for _ in range(len(data))
])
def test_compress(idx):
    input, output = data[idx]
    input = bytes.fromhex(input)
    output = bytes.fromhex(output)

    ret = ts_compress(input)

    len_input = len(ret)
    len_output = len(output)

    assert len_input == len_output


    # skip index.
    # bitflag : index 3
    # mtime : index 4 ~ 7
    # OS : index 9
    for i in range(len_input):
        if i == 3 or 4 <= i <= 7 or i == 9:
            pass
        else:
            assert ret[i] == output[i]


@pytest.mark.parametrize("idx", [
    _ for _ in range(len(data))
])
def test_decompress(idx):
    output, input = data[idx]
    input = bytes.fromhex(input)
    output = bytes.fromhex(output)

    ret = ts_uncompress(input)

    print(ret)
    assert ret[:10] == output[:10]
